import React from "react";
import "../App.css";

const Footer = () => {
  return (
    <>
      {/* Bootstrap core JS */}
      <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/js/bootstrap.bundle.min.js"></script>
      {/* Core theme JS */}
      <script src="js/scripts.js"></script>
    </>
  );
};

export default Footer;
